                    "Accountant - Experienced",
                    "210.316.350",
                    "2009 CN Chengdu-Chongqing TRS All Industries Survey Premium (Jul)",
                    "Common Duties and Responsibilities: Perform a variety of accounting activities in accordance with accounting principles and standards to control the organisation's financial resources and ensure that it complies with all relevant regulations, laws, and reporting requirements. Reconcile accounts, post journal entries, and maintain a complete and accurate general ledger in accordance with accounting principles and reporting schedules so that the organisation has a full and accurate statement of its financial position.\r\nCollect, compile, verify, and analyse financial information and prepare financial reports and accounting statements so that senior management has accurate and timely information for making financial decisions. These reports may include profit and loss statements, balance sheets, depreciation statements, cash flow, debtor and creditor lists, repayment schedules, regulatory reports and filings.\r\nProvide technical accounting advice within area of expertise to functional or operational areas managers to help them develop revenue and expense budgets, understand financial reports, and manage their financial responsibilities. Normally Reports To: MUPC level 23, e.g., Accounting Supervisor; MUPC level 22, e.g., Accounting Manager; Minimum Qualifications: University (Degree); Years of Experience: Up to 1.5",
