                    "Accountant - Senior",
                    "210.316.340",
                    "2009 CN Chengdu-Chongqing TRS All Industries Survey Premium (Jul)",
                    "Common Duties and Responsibilities: Perform more complex accounting activities in accordance with accounting principles and standards to control the organisation's financial resources and ensure that it complies with all relevant regulations, laws, and reporting requirements. Reconcile more complex accounts and check the accuracy of journal entries to ensure that the general ledger is accurate and complete.\r\nCheck and analyse financial information and prepare more complex financial reports and accounting statements so that senior management has accurate and timely information for making financial decisions. These reports may include profit and loss statements, balance sheets, depreciation statements, cash flow, debtor and creditor lists, repayment schedules, regulatory reports and filings.\r\nProvide technical accounting advice within area of expertise to functional or operational areas managers to help them develop revenue and expense budgets, understand financial reports, and manage their financial responsibilities.\r\nCoach less experienced accounting staff and help them resolve problems. Normally Reports To: MUPC level 23 , e.g., Accounting Supervisor; MUPC level 22, e.g., Accounting Manager; Minimum Qualifications: University (Degree); Years of Experience: 1 to 4",
