                    "210.316.420",
                    "2009 AR TRS Comp1-5 (Total Comp) (May)",
                    "Common Duties and Responsibilities: Follow established procedures and guidelines to perform clerical accounting procedures accurately and on time. Maintain accurate financial records or account books, for example a creditors and debtors ledger; and sales, purchase, and cash journals.\r\nMake standard calculations to accurately compile and report statistics.\r\nClassify, code and record financial transactions and post entries to the general ledger.\r\nCheck balance statements and other information provided by financial institutions.\r\nVerify and process accounts payable and receivable and other financial transactions such as bank deposits. Normally Reports To: MUPC level 23/24, e.g., Accounting Supervisor; MUPC level 22, e.g., Accounting Manager; Minimum Qualifications: Vocational; Years of Experience: Up to 1.5",
