                    "Cost Accounting Manager",
                    "210.340.220",
                    "2009 FR TRS (Comp1-5) (Apr)",
                    "Common Duties and Responsibilities: Plan, direct, and monitor the activities related to development and organisation of the company's costs system, involving analysis of the real cost of the products and their respective contribution margins. Manage the preparation of cost accounting records; design and implement cost control procedures.\r\nDevelop, install and monitor the cost control systems. \r\nInterpret and disseminate the cost accounting information to management; may participate in the most complex cost accounting projects.\r\nManage the activities related to development and organisation of the company's costs system; involving analysis of the real cost of the products and their respective contribution margins. \r\nManage teams with focus on policy and strategy implementation and control rather than development; short-term operational/tactical responsibilities. Normally Reports To: MUPC level 13, e.g., Accounting Director or Controller; MUPC level 12, e.g., Head of Finance and Accounting.; Minimum Qualifications: University (Degree); Years of Experience: 7 to 10",
