                    "210.000.120",
                    "2009 BR TRS Comp1-5 (Total Comp)Vikki Copy With Additional Refinements",
                    "Common Duties and Responsibilities: Lead, direct, and control the organisation's financial resources within the highest level of the organisation to maintain the short and long-term financial health of the business. Direct all corporate financial functions so that financial transactions, policies, and procedures meet the organisation's short and long-term business objectives and are conducted in accordance with regulations, accounting principles, and standards. Please note that associated organization type should be Parent/Independent. Activities may include: accounting; credit control; cash flow; investment management; tax; insurance; treasury; internal audit; budgeting and forecasting; and foreign exchange. Contribute to strategic planning and decision-making at the top executive level to develop and implement an financial strategy that aligns with the organisation's vision and business objectives. Direct the timely and accurate preparation of financial reports, such as profit and loss, balance sheet, management reports, and regulatory filings. Evaluate proposed business activities and transactions such as acquisitions, investments, capital expenditure, divestitures, mergers, or the sale of assets to ensure they are financially viable. Establish and maintain positive relationships with banks, investment analysts, and other financial institutions. Lead, direct, evaluate, and develop a team of senior managers. Normally Reports To: MUPC level 11, e.g., Head of Organisation - Tier 0; Minimum Qualifications: University (Degree); Years of Experience: 12 or more",
