                    "210.030.120",
                    "2009 AT TRS (Comp1-5) (Apr)",
                    "Common Duties and Responsibilities: Lead, direct, and control the organisation's financial resources to maintain the short and long-term financial health of the country or local business unit level. Please note that associated organization type should be Division. Direct all country/local business unit financial functions to ensure they meet the organisation's business objectives and are conducted in accordance with regulations and accounting principles. Contribute to strategic planning and decision-making at the top executive level to develop and implement a financial strategy that aligns with the organisation's business objectives. Direct the preparation of the organisation's financial reports, such as profit and loss accounts, balance sheet, management financial reports, and regulatory reports and filings. Evaluate acquisitions, investments, capital expenditure, divestitures, mergers, or the sale of assets to ensure they are financially viable. Establish and maintain positive relationships with banks, investment analysts, and other financial institutions. Lead, direct, evaluate, and develop a team of senior managers to ensure the organisation's financial strategy is implemented effectively, consistently and according to established guidelines. Normally Reports To: MUPC level 11, e.g., Head of Organisation - Tier 3; Minimum Qualifications: University (Degree); Years of Experience: 10 or more",
