                    "420.488.340",
                    "2009 AT TRS (Comp1-5) (Apr)",
                    "Common Duties and Responsibilities: Responsible for providing ongoing support to high value clients. Implement business strategies to achieve profitable business relationships and identify new revenue opportunities with major accounts. Develop and maintain strategic business relationships with major accounts to promote brand awareness and profitable business relationships. Provide ongoing support to high value clients ensuring they receive high quality customer service. Possess very detailed product knowledge as well as thorough knowledge of client's business. Responsible for the direct sales process, aiming at meeting and / or exceeding sales targets. Organise visits to current and potential clients. Responsible for retaining long-term customer relationships with established clients. Serve as a liaison between clients and company departments. Informs clients of new products and services as they are introduced. Recommend products and services that fit well with clients' business needs. Normally Reports To: MUPC level 22, e.g., Account Management Manager; or MUPC level 12 Head of Sales; Minimum Qualifications: University (Degree); Years of Experience: 4 to 7",
